import React from 'react';
import { Text,StyleSheet, View, TouchableOpacity,Image } from 'react-native';
import { FontAwesome5 } from '@expo/vector-icons'; 
import { MaterialCommunityIcons } from '@expo/vector-icons';
const Icons =props => {
        return (
          <View>
              
          <View style={styles.itemView1}>
          <View style={styles.itemView2}>
              
                 
                    
                    <Image source={require('../assets/song.png')}  style={styles.itemFont} />
            
                    <Text style={styles.itemText}>Lundi 12 Mars 2021</Text> 
          </View>
          <View style={styles.itemView2}>
               <TouchableOpacity>
               <MaterialCommunityIcons name="weather-rainy" style={styles.itemFont2} />
              
             </TouchableOpacity>
                    <Text style={styles.itemText}>Lundi 12 Mars 2021</Text> 
          </View>
          </View>
          <View style={styles.itemView1}>
          <View style={styles.itemView2}>
               <TouchableOpacity>
               <MaterialCommunityIcons name="weather-sunny" style={styles.itemFont2} />
             </TouchableOpacity>
                    <Text style={styles.itemText}>Lundi 12 Mars 2021</Text> 
          </View>
      
          </View>
         
        </View>
        );
      };
    // create style to component
    const styles = StyleSheet.create({
      itemView1: {
       
        flexDirection: 'row'
      },
      itemView2: {
        backgroundColor: 'white',
        height:150,
        width:150,
        margin:10,
        marginRight:10,
        marginLeft:20,
        shadowColor: "#000",
        shadowOffset: {
          width: 0,
          height: 16,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.00,
        
        elevation: 24,
      },
      itemFont: {
       color:'red',
       fontSize:24,
       marginTop:20,
       marginLeft:40,
       backgroundColor: 'white',
       borderRadius: 500,
       width:70,
       padding:20,
       shadowColor: "#000",
       shadowOffset: {
         width: 0,
         height: 16,
       },
       shadowOpacity: 0.58,
       shadowRadius: 16.00,
       
       elevation: 24,
       
      },
      itemFont2: {
        color:'blue',
        fontSize:24,
        marginTop:20,
        marginLeft:40,
        backgroundColor: 'white',
        borderRadius: 500,
        width:70,
        padding:20,
        shadowColor: "#000",
        shadowOffset: {
          width: 0,
          height: 16,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.00,
        
        elevation: 24,
        
       },
      itemText:{
        textAlign: 'center'
      }
      });
    //Export to component so we can use it elsewhere in our project
    export default  Icons ;
